import React, {useState, useEffect} from 'react'

export const Pokemon = () => {
    const [charizard, setCharizard] = useState();
    useEffect(() => {
        fetch("https://pokeapi.co/api/v2/pokemon/charizard").then(res => res.json()).then(
            (pokemon) => setCharizard(pokemon)
        ).catch(err => console.log(err))
    });
  return (
    <div>Pokemon</div>
  )
}
